import { useState } from "react";
import classes from "./History.module.css";
import Selector from "../Selectors/Selector";
import Modal from "../modal/Modal";

const options = [
  { value: "На рассмотрении", label: "На рассмотрении" },
  { value: "Выдано", label: "Выдано" },
  { value: "Отказано", label: "Отказано" },
];

export default function HistoryBuyTable({ data, user }) {
  const [state, setState] = useState("");
  const [modal, setModal] = useState(true);
  return (
    <div>
      <h2>История покупок</h2>
      <p>История покупок не очищается</p>
      <table
        className={`${classes.generalTable} ${classes.historyBuy}`}
        id="history"
      >
        <thead>
          <tr>
            <td># п/п</td>
            <td>Никнейм модератора</td>
            <td>Дата покупки</td>
            <td>Наименование услуги</td>
            <td>Количество</td>
            <td>Цена</td>
            {user["max_role"]["lvl"] > 4 && <td>Действие</td>}
          </tr>
        </thead>
        <tbody>
          {data.map((value, index) => {
            return (
              <tr key={value.id}>
                <td>{index + 1}</td>
                <td>{value.user}</td>
                <td>{value.date}</td>
                <td>{value.item}</td>
                <td>{value.amount}</td>
                <td>{value.price}</td>
                {user["max_role"]["lvl"] > 4 && (
                  <button
                    onClick={() => {
                      setState(value.state);
                      setModal(true);
                    }}
                  >
                    {value.state}
                  </button>
                )}
              </tr>
            );
          })}
        </tbody>
      </table>
      <Modal visible={modal} setVisible={setModal}>
        <Selector
          options={options}
          de={{ value: value.state, label: value.state }}
        />
      </Modal>
    </div>
  );
}
